import CoreData

typealias DataSelcted<T> = (DatabaseResult<T>) -> ()

enum DatabaseResult<T> {
    case error(error: Error)
    case success(result : [T])
}

final class CoreDataStack: Repository {
    
    //MARK:- Constants
    
    private let privateContext: NSManagedObjectContext
    private lazy var context: NSManagedObjectContext = {
       return persistentContainer.viewContext
    }()
    
    //MARK:- CoreDataStack life cycle
    
    init() {
        privateContext = NSManagedObjectContext(concurrencyType: .privateQueueConcurrencyType)
        privateContext.persistentStoreCoordinator = context.persistentStoreCoordinator
    }
    
    //MARK:- Main
    
    func insert<T>(model: Codable, `as` type: T.Type) where T : PopulateProtocol {
        privateContext.perform { [weak self] in
            guard let `self` = self else { return }
            let mo = T(context: self.privateContext)
            mo.update(with: model)
            self.privateContext.insert(mo)
            self.saveContext()
        }
    }
    
    func select<T>(`as` type: T.Type, completion: DataSelcted<T>) where T: PopulateProtocol {
        do {
            guard let  result =  try privateContext.fetch(type.fetchRequest()) as? [T] else { return }
            completion(DatabaseResult.success(result: result))
        } catch {
            completion(DatabaseResult.error(error: error))
        }        
    }
    
    //MARK: - CoreData stack
    
    private lazy var persistentContainer: NSPersistentContainer = {
        let container = NSPersistentContainer(name: "Database")
        container.loadPersistentStores(completionHandler: { (storeDescription, error) in
            if let error = error as NSError? {
                fatalError("Unresolved error \(error), \(error.userInfo)")
            }
        })
        return container
    }()
    
    private func saveContext () {
        guard privateContext.hasChanges else { return }
        do {
            try privateContext.save()
            context.perform {
                do {
                    try self.context.save()
                    print("Saved new data in database")
                } catch let error {
                    print("Could not save main context: \(error.localizedDescription)")
                }
            }
        } catch let error {
            print("Could not save private context: \(error.localizedDescription)")
        }
    }
}
